mision:
1. Mewujudkan Pemerintahan Yang Baik dan Bersih (Good Government And Clean Governance) serta transparan dan akuntable;
2. Meningkatkan Kualitas Sumber Daya Manusia melalui Pendidikan Dan Kesehatan yang terjangkau;
3. Meningkatkan Kreatifitas Pemanfaatan Keterdapatan Potensi Pariwisata Yang Berbudaya;
4. Meningkatkan Peranan Pangan dengan pola penataan pemanfaatan Pertanahan Dan Pertanian Serta Peternakan;
5. Meningkatkan Kualitas dan Kuantitas Infrastruktur sesuai Tata Ruang Wilayah Dan Lingkungan Hidup;
6. Memfasilitasi Peningkatan Peranan Koperasi, UKM, Perindustrian Dan Perdagangan;
7. Memfasilitasi Peningkatan Peran Masyarakat Dan Desa Dalam Setiap Aspek Kehidupan;
8. Merangsang Kreasi Kepemudaan Dan Prestasi Keolahragaan;
9. Memfasilitasi Pendayagunaan Kolaborasi (Gotong Royong) Pemangku Kepentingan;

1) MENINGKATKAN SUMBER DAYA MANUSIA (SDM) YANG HANDAL DAN RELIGIUS;
2) MEMBANGUN PEREKONOMIAN MASYARAKAT YANG KOKOH, MAJU DAN BERKEADILAN;
3) MENCIPTAKAN IKLIM USAHA YANG KONDUSIF BAGI MASYARAKAT BANGKA SELATAN;
4) MEMBANGUN PEMERINTAHAN YANG EFEKTIF, BERSIH DAN BERWIBAWA;
5) MENINGKATKAN INFRASTRUKTUR YANG HANDAL DAN BERKUALITAS.

1) MEWUJUDKAN AKSEBILITAS DAN KUALITAS PELAYANAN BIDANG PENDIDIKAN, KESEHATAN DAN KEBUTUHAN DASAR LAINNYA;
2) MEWUJUDKAN DAYA SAING EKONOMI DAERAH MELALUI PERTUMBUHAN EKONOMI YANG BERKUALITAS DAN BERKELANJUTAN BERBASIS POTENSI SUMBERDAYA ALAM DAN KEARIFAN LOKAL;
3) MENINGKATKAN KUANTITAS DAN KUALITAS INFRASTRUKTUR FISIK, EKONOMI, DAN SOSIAL;
4) OPTIMALISASI SUMBERDAYA DAERAH BERBASIS PEMBERDAYAAN MASYARAKAT, PEMBANGUNAN BERKELANJUTAN DAN BERWAWASAN LINGKUNGAN.
5) MEWUJUDKAN TATA PEMERINTAHAN YANG BAIK DAN BERSIH (GOOD AND CLEAN GOVERNANCE) SERTA LAYANAN PUBLIK YANG BERKUALITAS BERBASIS TEKNOLOGI INFORMASI

1. Meningkatkan Kualitas Kesejahteraan Masyarakat;
2. Meningkatkan Perekonomian Masyarakat berbasis pada Agribisnis dan Agroindustri;
3. Meningkatkan Kualitas Kehidupan Masyarakat melalui Pendidikan, Kesehatan, Budaya dan Agama;
4. Meningkatkan Tata Kelola Pemerintahan yang Baik dan Bebas Korupsi.
